import React from 'react';

const Projects = () => {
    return (
        <section id="projects">
            <h2>My Projects</h2>
            <div>
                <h3>Project 1</h3>
                <p>Description of project 1...</p>
            </div>
            <div>
                <h3>Project 2</h3>
                <p>Description of project 2...</p>
            </div>
        </section>
    );
};

export default Projects;
